import Axios from 'axios'

const LoginData = () => {
    Axios.get("http://localhost:4500/view-all").then( (response) => {
      console.log("Retrieved login data");
      const LoginTable = response
      console.log(response)
      return (LoginTable.data)
    });
  };


export default LoginData
